import SkillsMoreGrid from './styled/SkillsMoreGrid.styled'
import { GitHubSvg, LinkedInSvg, StackSvg } from './styled/Icons.styled';

const ForMore = () => {
  return (
    <SectionContainer>
      <SectionMainHeading>For More</SectionMainHeading>
      <SkillsMoreGrid>
        <StyledIcon>
          <a href="https://github.com/karlfredrikholm/" target="_blank" rel="noreferrer">
            <GitHubSvg />
          GitHub
          </a>
        </StyledIcon>
        <StyledIcon>
          <StackSvg />
          <a>Stack Overflow</a>
        </StyledIcon>
        <StyledIcon>
          <LinkedInSvg />
          <a>LinkedIn</a>
        </StyledIcon>
      </SkillsMoreGrid>
    </SectionContainer>
  )
}

export default ForMore

